    public static List<String> generateParenthesis1(int n) {
        List<String> res = new ArrayList<>();
        res.add("()");

        String s = "()";
        if (n == 1) return res;
        for (int i = 2; i <= n; i++) {
            int finalI = i - 1;
            Set<String> set = res.stream().filter(r -> r.length() == 2 * finalI).collect(Collectors.toSet());
            for (String set1 : set) {
                for (int j = 0; j < set1.length(); j++) {
                    String temp = set1.substring(0, j) + s + set1.substring(j);
                    res.add(temp);
                }
            }
        }
        return res.stream().filter(r -> r.length() == 2 * n).distinct().collect(Collectors.toList());
    }
